import GrandPrixItem from './GrandPrixItem';

const GrandPrixList = ({ grandsPrix }) => {
  return (
    <div>
      {grandsPrix.map((grandPrix, index) => (
        <GrandPrixItem key={index} grandPrix={grandPrix} />
